export default function ProductCards(props){
    return(
            <div className="aem-Grid aem-Grid--12">
              {props.data.map((product) => {
                return (
                  <>
                  <section className="aem-GridColumn aem-GridColumn--default--3"></section>
                  <section key={product.id} className="aem-GridColumn aem-GridColumn--default--3">
                    <img className="prod-image" src={product.image} alt=""/>
                    <h3 className="prod-title">{product.title}</h3>
        
                      <div className="right-column">
                        <div className="product-description">
                          {/* <p>
                          {product.description}
                          </p> */}
                        </div>
        
                        <div className="product-price">
                          <span>Price:- {product.price}/-</span>
                          <a href="#$" className="cart-btn">
                            Add to cart
                          </a>
                        </div>
                      </div>
                  </section>
                  </>
                );
              })}
            </div>
          );
}
